  return (

   <Router>

    <Navbar/>
    <Route path="/">
      //HOME
    </Route>

   <Route path="/note">
     //Note
   </Route>

   <Route path="/create">
     //Create Note
   </Route>
   </Router>
  );
}

export default App;
